import React from "react";
import { useNavigate } from "react-router-dom";

export default function Landing() {
  const navigate = useNavigate();
  return (
    <div style={{
      minHeight: "100vh",
      background: "linear-gradient(120deg,#101824 0%,#1c2740 100%)",
      color: "#fff",
      fontFamily: "Segoe UI, Inter, Arial, sans-serif",
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      justifyContent: "center",
      padding: 20
    }}>
      <img
        src="/venoai-logo.png"
        alt="VENO.AI"
        style={{
          width: 180,
          marginBottom: 30,
          filter: "drop-shadow(0 8px 25px #00e0ff90)",
          animation: "logoGlow 3s ease-in-out infinite alternate"
        }}
      />
      <h1 style={{ fontSize: 38, fontWeight: 800, marginBottom: 10, letterSpacing: 2 }}>
        VENO.AI
      </h1>
      <h2 style={{ fontSize: 22, fontWeight: 400, margin: "0 0 14px" }}>
        Gerador de Laudos Doppler Vascular Inteligente
      </h2>
      <p style={{ fontSize: 17, maxWidth: 480, opacity: 0.78, marginBottom: 24 }}>
        Crie, edite e gerencie laudos Doppler venoso e arterial de forma prática, organizada e segura, com exportação em PDF e acesso pelo celular, tablet ou computador.<br /><br />
        <span style={{ color: "#0eb8d0", fontWeight: 600 }}>Seu consultório digital, com tecnologia e segurança.</span>
      </p>
      <div style={{ marginBottom: 32 }}>
        <button
          onClick={() => navigate("/login")}
          style={{
            background: "#0eb8d0",
            color: "#fff",
            border: "none",
            borderRadius: 10,
            fontWeight: 600,
            fontSize: 19,
            padding: "14px 38px",
            cursor: "pointer",
            boxShadow: "0 2px 12px #00e0ff45",
            letterSpacing: 1,
            marginRight: 12
          }}
        >
          Entrar / Cadastrar
        </button>
      </div>
      <footer style={{ marginTop: 30, fontSize: 14, color: "#aae", opacity: 0.7 }}>
        &copy; {new Date().getFullYear()} VENO.AI &middot; Gabriel Bordonal
      </footer>
      <style>
        {`
          @keyframes logoGlow {
            0% {
              filter: drop-shadow(0 8px 25px #00e0ff90);
            }
            100% {
              filter: drop-shadow(0 12px 35px #00e0ffc0);
            }
          }
        `}
      </style>
    </div>
  );
}
